  body({ isStatic: true }),
  color(127, 200, 225)
]);
setGravity(1600);
loop(1.75, () => {
  score += 1;
  scoreLabel.text = score;
  add([
    rect(48, 64),
    area(),
    outline(4),
    pos(width(), height() - 28),
    anchor("botleft"),
    color(255, 180, 255),
    move(LEFT, 240),
    "tree"
  ]);
});
player.onCollide("tree", () => {
  addKaboom(player.pos);
  shake();
});
function spawnTree() {
  add([
    rect(48, rand(24, 64))
  ]);
  wait(rand(0.5, 1.5), () => {
    spawnTree();
  });
}
spawnTree();
scene("lose", () => {
  if (score == 10) {
    add([text("You win!"), pos(center()), anchor("center")]);
  } else {
    add([text("Game Over"), pos(center()), anchor("center")]);
  }
});
player.onCollide("tree", () => {
  addKaboom(player.pos);
  shake();
  go("lose");
});

    </script>
</body>
</html>
